  const navigate = useNavigate();
    const itemAddHandler = function(itemData) {
        // itemData.id=123;
        props.addItemHandler(itemData);
        navigate('/loggedin')
    };

  return (
    <div>
        <AddItem onAddItem={itemAddHandler} />
    </div>
  );
}

